import React, {Component} from 'react';

class Body extends Component{
    state= {
      images: [
          "https://images.pexels.com/photos/248797/pexels-photo-248797.jpeg",
          "https://images.pexels.com/photos/34950/pexels-photo.jpg",
          "https://www.google.co.in/url?sa=i&source=images&cd=&cad=rja&uact=8&ved=2ahUKEwid0NLzwJfeAhXKPI8KHftBAAwQjRx6BAgBEAU&url=https%3A%2F%2Fperureports.com%2Fterriffic-travel-blog-hibiscus-nomada-acquired-espacio-incubator%2F6799%2F&psig=AOvVaw30scaWgvDB9JfKBFUFBixc&ust=1540210301973245"
      ]
    };
    render() {
        return (
            <div>
                {this.state.images.map(image => <div key={image}><img src={image} /></div>)}
            </div>
        );
    }
}

export default Body;
